import React from 'react';
import steamboat_ad from './steamboat_ad.jpg';
import './App.css';

function App() {
  return (
    <div className="App">
      <img src={steamboat_ad} className="steamboat-ad" alt="1884 Steamboat Ad" />
    </div>
  );
}

export default App;
